import React from "react";
import { UsersContainer } from "./containers/users";
import { GlobalStyles } from "./global-styles";
import GlobalFonts from './globalfonts';
import "normalize.css";

const App = () => {
  return (
    <>
      <GlobalFonts />
      <GlobalStyles />
      <UsersContainer />
    </>
  );
}

export default App;
